import Pagination from '@mui/material/Pagination';


const theme = {
    palette: {
        type: 'dark'
    }
};

const CustomPagination = ({ setPage, numOfPages }) => {

    const pageChanged = (page) => {
        setPage(page);
    }


    return (
        <div>
            <ThemeProvinder theme={theme}>
                <Pagination count={(numOfPages <= 500)? numOfPages : 500 } shape="rounded" onChange={(e) => pageChanged(e.target.textContent)} />
            </ThemeProvinder>
        </div>
    )
}

export default CustomPagination
